import axios from "axios";
import "bootstrap/dist/css/bootstrap.min.css";
import { useEffect, useState } from "react";
// import React, { useState } from "react";
// import './css/style.css';
import {useParams} from "react-router-dom";

const Film = (props) => {

  const params  = useParams()
	console.log(params, "params")// params link 
	console.log(props, "props")

	const [filmInfo, setInfo] = useState({})

	// .get(`https://api.themoviedb.org/3/movie/${params.id}?api_key=2e5d307a9142003b321ca6029b44fe63`)

  useEffect(() => {
		axios
		.get(`https://api.themoviedb.org/3/movie/880009?api_key=2e5d307a9142003b321ca6029b44fe63`)
		.then((res)=> {
			console.log(res)
			setInfo(res.data)

		})
		.catch((err) => {
			console.log(err)
		})
	}, [])












  return (

    <>
       <h1> {filmInfo.title} </h1> 
       <ul>
         <li>{filmInfo.overview}</li>
       </ul>

    </>
  );
};

export default Film;
